.intro_video {
  width: 100%;
  height: 100vh;
  position: relative;
  position: fixed;
  top: -50px;
  left: 0;
  /* left: 50%; */
  /* transform: translateX(-50%); */
  z-index: 20;
  /* transition: 0.7s; */
  transition: all 1.5s ease-in-out;
  transform-origin: center center;


  .intro_video_element {
    transform-origin: center center;
  }


  .progress-bar {
    position: absolute;
    width: 300px;
    height: 20px;
    border: 1px solid #333;
    bottom: -20px;
    left: 50px;

    .progress-bar-fill {
      position: absolute;
      top: 0;
      left: 0;
      bottom: 0;
      width: 0%;
      background-color: #00CD3C;
      animation: fill 7.5s linear forwards;
    }

    @keyframes fill {
      from {
        width: 0%;
      }

      to {
        width: 100%;
      }
    }
  }


  .video_skip {
    width: 150px;
    height: 50px;
    border: 1px solid black;
    border-radius: 15px;
    position: absolute;
    bottom: -30px;
    right: 100px;
    background-color: #e6ddd4;
    text-align: center;
    line-height: 50px;
    cursor: pointer;
    transition: 0.3s;
    font-size: 18px;
    box-sizing: border-box;
    /* box-shadow: 0 1rem 2rem hsla(0, 0%, 0%, 0.2); */
  }

  .video_skip:hover {
    background-color: #00CD3C;
    color: #fff;
  }

}


